import CvHeader from "./00_header/CvHeader";
import CvSectionsRender from "./01_about/CvSectionsRender";
import CvNavigation from "./navigation/CvNavigation";
import { Routes, Route } from "react-router-dom";

const CvRender = () => {
  return (
    <>
      <CvNavigation />
      <CvHeader />
      <Routes>
        <Route path="/" element={<CvSectionsRender />} />
      </Routes>
      {/* <CvSectionsRender /> */}
    </>
  );
};

export default CvRender;
